"""***BACK TESTING/TIME SERIES CROSS-VALIDATION***"""

def backtest(weather_dataset, model, predictors, start = 3650, step = 90):
  all_predictions = []

  for i in range(start, weather_dataset.shape[0], step):
    train = weather_dataset.iloc[:i,:] #Take all of the data that comes before the current row to use as our training data
    test = weather_dataset.iloc[i:(i+step),:] #This going to take the next 90 days to make predictions on

    model.fit(train[predictors], train["TARGET"])

    preds = model.predict(test[predictors]) #Generate our predictions

    preds = pd.Series(preds, index=test.index)
    combined = pd.concat([test["TARGET"], preds], axis=1) #Trun into single dataframe

    combined.columns = ["ACTUAL", "PREDICTION"]
    combined["DIFFERENCE"] = (combined["PREDICTION"] - combined["ACTUAL"]).abs()

    all_predictions.append(combined)
  return pd.concat(all_predictions)

"""***CALLING FUNCTION >>***"""

predictions = backtest(weather_dataset, rr, predictors)
predictions

