"""**ADDING PREDICTORS TO IMPROVE ACCURACY >>**"""

def pct_diff(old, new):
  return (new-old) / old

#Rolling average for the past few periods
def compute_rolling(weather_dataset, horizon, col):
  label = f"Rolling_{horizon}_{col}"

  weather_dataset[label] = weather_dataset[col].rolling(horizon).mean()
  weather_dataset[f"{label}_Pct"] = pct_diff(weather_dataset[label], weather_dataset[col])
  return weather_dataset

rolling_horizons = [3, 14]
for horizon in rolling_horizons:
  for col in ["TMAX", "TMIN", "TAVG"]:
    weather_dataset = compute_rolling(weather_dataset, horizon, col)

weather_dataset

weather_dataset = weather_dataset.iloc[14:,:] #Cut missing value
weather_dataset

weather_dataset = weather_dataset.fillna(0) #find missing value and fill them with zero

"""***CONVERT THE DATE COLUMN TO DATETIME FORMAT AND SET IT AS THE INDEX >>***

**COUPLE MORE PREDICTORS >>**
"""

def expand_mean(df):
    return df.expanding(1).mean()

for col in ["TMAX", "TMIN", "TAVG"]:
    # Reset index before grouping to avoid duplicate index labels
    weather_dataset[f"Month_Avg_{col}"] = weather_dataset.reset_index()[col].groupby(weather_dataset.index.month, group_keys=False).apply(expand_mean).values
    weather_dataset[f"Day_Avg_{col}"] = weather_dataset.reset_index()[col].groupby(weather_dataset.index.day_of_year, group_keys=False).apply(expand_mean).values

weather_dataset

